hebsuperobject.biblemap.put("b30_6_1", new hebsuperobject(30,6,1,"הוי השאננים בציון והבטחים בהר שמרון נקבי ראשית הגוים ובאו להם בית ישראל׃"));
hebsuperobject.biblemap.put("b30_6_2", new hebsuperobject(30,6,2,"עברו כלנה וראו ולכו משם חמת רבה ורדו גת פלשתים הטובים מן הממלכות האלה אם רב גבולם מגבלכם׃"));
hebsuperobject.biblemap.put("b30_6_3", new hebsuperobject(30,6,3,"המנדים ליום רע ותגישון שבת חמס׃"));
hebsuperobject.biblemap.put("b30_6_4", new hebsuperobject(30,6,4,"השכבים על מטות שן וסרחים על ערשותם ואכלים כרים מצאן ועגלים מתוך מרבק׃"));
hebsuperobject.biblemap.put("b30_6_5", new hebsuperobject(30,6,5,"הפרטים על פי הנבל כדויד חשבו להם כלי שיר׃"));
hebsuperobject.biblemap.put("b30_6_6", new hebsuperobject(30,6,6,"השתים במזרקי יין וראשית שמנים ימשחו ולא נחלו על שבר יוסף׃"));
hebsuperobject.biblemap.put("b30_6_7", new hebsuperobject(30,6,7,"לכן עתה יגלו בראש גלים וסר מרזח סרוחים׃"));
hebsuperobject.biblemap.put("b30_6_8", new hebsuperobject(30,6,8,"נשבע אדני יהוה בנפשו נאם יהוה אלהי צבאות מתאב אנכי את גאון יעקב וארמנתיו שנאתי והסגרתי עיר ומלאה׃"));
hebsuperobject.biblemap.put("b30_6_9", new hebsuperobject(30,6,9,"והיה אם יותרו עשרה אנשים בבית אחד ומתו׃"));
hebsuperobject.biblemap.put("b30_6_10", new hebsuperobject(30,6,10,"ונשאו דודו ומסרפו להוציא עצמים מן הבית ואמר לאשר בירכתי הבית העוד עמך ואמר אפס ואמר הס כי לא להזכיר בשם יהוה׃"));
hebsuperobject.biblemap.put("b30_6_11", new hebsuperobject(30,6,11,"כי הנה יהוה מצוה והכה הבית הגדול רסיסים והבית הקטן בקעים׃"));
hebsuperobject.biblemap.put("b30_6_12", new hebsuperobject(30,6,12,"הירצון בסלע סוסים אם יחרוש בבקרים כי הפכתם לראש משפט ופרי צדקה ללענה׃"));
hebsuperobject.biblemap.put("b30_6_13", new hebsuperobject(30,6,13,"השמחים ללא דבר האמרים הלוא בחזקנו לקחנו לנו קרנים׃"));
hebsuperobject.biblemap.put("b30_6_14", new hebsuperobject(30,6,14,"כי הנני מקים עליכם בית ישראל נאם יהוה אלהי הצבאות גוי ולחצו אתכם מלבוא חמת עד נחל הערבה׃"));
hebsuperobject.biblemap.put("b30_7_1", new hebsuperobject(30,7,1,"כה הראני אדני יהוה והנה יוצר גבי בתחלת עלות הלקש והנה לקש אחר גזי המלך׃"));
hebsuperobject.biblemap.put("b30_7_2", new hebsuperobject(30,7,2,"והיה אם כלה לאכול את עשב הארץ ואמר אדני יהוה סלח נא מי יקום יעקב כי קטן הוא׃"));
