hebsuperobject.biblemap.put("b30_7_4", new hebsuperobject(30,7,4,"כה הראני אדני יהוה והנה קרא לרב באש אדני יהוה ותאכל את תהום רבה ואכלה את החלק׃"));
hebsuperobject.biblemap.put("b30_7_5", new hebsuperobject(30,7,5,"ואמר אדני יהוה חדל נא מי יקום יעקב כי קטן הוא׃"));
