hebsuperobject.biblemap.put("b30_7_11", new hebsuperobject(30,7,11,"כי כה אמר עמוס בחרב ימות ירבעם וישראל גלה יגלה מעל אדמתו׃"));
hebsuperobject.biblemap.put("b30_7_12", new hebsuperobject(30,7,12,"ויאמר אמציה אל עמוס חזה לך ברח לך אל ארץ יהודה ואכל שם לחם ושם תנבא׃"));
hebsuperobject.biblemap.put("b30_7_13", new hebsuperobject(30,7,13,"ובית אל לא תוסיף עוד להנבא כי מקדש מלך הוא ובית ממלכה הוא׃"));
