hebsuperobject.biblemap.put("b30_7_15", new hebsuperobject(30,7,15,"ויקחני יהוה מאחרי הצאן ויאמר אלי יהוה לך הנבא אל עמי ישראל׃"));
hebsuperobject.biblemap.put("b30_7_16", new hebsuperobject(30,7,16,"ועתה שמע דבר יהוה אתה אמר לא תנבא על ישראל ולא תטיף על בית ישחק׃"));
hebsuperobject.biblemap.put("b30_7_17", new hebsuperobject(30,7,17,"לכן כה אמר יהוה אשתך בעיר תזנה ובניך ובנתיך בחרב יפלו ואדמתך בחבל תחלק ואתה על אדמה טמאה תמות וישראל גלה יגלה מעל אדמתו׃"));
hebsuperobject.biblemap.put("b30_8_1", new hebsuperobject(30,8,1,"כה הראני אדני יהוה והנה כלוב קיץ׃"));
hebsuperobject.biblemap.put("b30_8_2", new hebsuperobject(30,8,2,"ויאמר מה אתה ראה עמוס ואמר כלוב קיץ ויאמר יהוה אלי בא הקץ אל עמי ישראל לא אוסיף עוד עבור לו׃"));
hebsuperobject.biblemap.put("b30_8_3", new hebsuperobject(30,8,3,"והילילו שירות היכל ביום ההוא נאם אדני יהוה רב הפגר בכל מקום השליך הס׃"));
hebsuperobject.biblemap.put("b30_8_4", new hebsuperobject(30,8,4,"שמעו זאת השאפים אביון ולשבית ענוי ארץ׃"));
