hebsuperobject.biblemap.put("b30_8_9", new hebsuperobject(30,8,9,"והיה ביום ההוא נאם אדני יהוה והבאתי השמש בצהרים והחשכתי לארץ ביום אור׃"));
hebsuperobject.biblemap.put("b30_8_10", new hebsuperobject(30,8,10,"והפכתי חגיכם לאבל וכל שיריכם לקינה והעליתי על כל מתנים שק ועל כל ראש קרחה ושמתיה כאבל יחיד ואחריתה כיום מר׃"));
hebsuperobject.biblemap.put("b30_8_11", new hebsuperobject(30,8,11,"הנה ימים באים נאם אדני יהוה והשלחתי רעב בארץ לא רעב ללחם ולא צמא למים כי אם לשמע את דברי יהוה׃"));
hebsuperobject.biblemap.put("b30_8_12", new hebsuperobject(30,8,12,"ונעו מים עד ים ומצפון ועד מזרח ישוטטו לבקש את דבר יהוה ולא ימצאו׃"));
hebsuperobject.biblemap.put("b30_8_13", new hebsuperobject(30,8,13,"ביום ההוא תתעלפנה הבתולת היפות והבחורים בצמא׃"));
hebsuperobject.biblemap.put("b30_8_14", new hebsuperobject(30,8,14,"הנשבעים באשמת שמרון ואמרו חי אלהיך דן וחי דרך באר שבע ונפלו ולא יקומו עוד׃"));
hebsuperobject.biblemap.put("b30_9_1", new hebsuperobject(30,9,1,"ראיתי את אדני נצב על המזבח ויאמר הך הכפתור וירעשו הספים ובצעם בראש כלם ואחריתם בחרב אהרג לא ינוס להם נס ולא ימלט להם פליט׃"));
hebsuperobject.biblemap.put("b30_9_2", new hebsuperobject(30,9,2,"אם יחתרו בשאול משם ידי תקחם ואם יעלו השמים משם אורידם׃"));
