hebsuperobject.biblemap.put("b30_9_4", new hebsuperobject(30,9,4,"ואם ילכו בשבי לפני איביהם משם אצוה את החרב והרגתם ושמתי עיני עליהם לרעה ולא לטובה׃"));
hebsuperobject.biblemap.put("b30_9_5", new hebsuperobject(30,9,5,"ואדני יהוה הצבאות הנוגע בארץ ותמוג ואבלו כל יושבי בה ועלתה כיאר כלה ושקעה כיאר מצרים׃"));
hebsuperobject.biblemap.put("b30_9_6", new hebsuperobject(30,9,6,"הבונה בשמים מעלותו ואגדתו על ארץ יסדה הקרא למי הים וישפכם על פני הארץ יהוה שמו׃"));
hebsuperobject.biblemap.put("b30_9_7", new hebsuperobject(30,9,7,"הלוא כבני כשיים אתם לי בני ישראל נאם יהוה הלוא את ישראל העליתי מארץ מצרים ופלשתיים מכפתור וארם מקיר׃"));
hebsuperobject.biblemap.put("b30_9_8", new hebsuperobject(30,9,8,"הנה עיני אדני יהוה בממלכה החטאה והשמדתי אתה מעל פני האדמה אפס כי לא השמיד אשמיד את בית יעקב נאם יהוה׃"));
hebsuperobject.biblemap.put("b30_9_9", new hebsuperobject(30,9,9,"כי הנה אנכי מצוה והנעותי בכל הגוים את בית ישראל כאשר ינוע בכברה ולא יפול צרור ארץ׃"));
hebsuperobject.biblemap.put("b30_9_10", new hebsuperobject(30,9,10,"בחרב ימותו כל חטאי עמי האמרים לא תגיש ותקדים בעדינו הרעה׃"));
hebsuperobject.biblemap.put("b30_9_11", new hebsuperobject(30,9,11,"ביום ההוא אקים את סכת דויד הנפלת וגדרתי את פרציהן והרסתיו אקים ובניתיה כימי עולם׃"));
hebsuperobject.biblemap.put("b30_9_12", new hebsuperobject(30,9,12,"למען יירשו את שארית אדום וכל הגוים אשר נקרא שמי עליהם נאם יהוה עשה זאת׃"));
hebsuperobject.biblemap.put("b30_9_13", new hebsuperobject(30,9,13,"הנה ימים באים נאם יהוה ונגש חורש בקצר ודרך ענבים במשך הזרע והטיפו ההרים עסיס וכל הגבעות תתמוגגנה׃"));
hebsuperobject.biblemap.put("b30_9_14", new hebsuperobject(30,9,14,"ושבתי את שבות עמי ישראל ובנו ערים נשמות וישבו ונטעו כרמים ושתו את יינם ועשו גנות ואכלו את פריהם׃"));
hebsuperobject.biblemap.put("b30_9_15", new hebsuperobject(30,9,15,"ונטעתים על אדמתם ולא ינתשו עוד מעל אדמתם אשר נתתי להם אמר יהוה אלהיך׃"));

